    return profList
}

export function getData() {
    return dispatch => {
        let apiEndpoint = `/professors?access_token=${localStorage.token}`;
        classService.get(apiEndpoint)
        .then(response => { 
            dispatch({ type: "DATA_LOADED", payload: response.data });
        }).catch(error => {
        });
    };
};

function getProfBySubjectId(professors, subject_id) {
    let profInfo = []
    professors.forEach(profItem => {
        if (!(_.isEmpty(profItem.profSubjects))) {
           profInfo = profItem.profSubjects.map(element => {
            if (element.id === subject_id) { return profItem }
